import './App.css';

import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
        <Navbar/>

        <Switch>
          <Route path="/"><News pageSize={6} country="in" cartegory="general" /></Route>
          <Route path="/business"><News pageSize={6} country="in" cartegory="business" /></Route>
  <Route path="/entertainment"><News pageSize={6} country="in" cartegory="entertainment" /></Route>
  <Route path="/general"><News pageSize={6} country="in" cartegory="general" /></Route>
  <Route path="/health"><News pageSize={6} country="in" cartegory="health" /></Route>
  <Route path="/science"><News pageSize={6} country="in" cartegory="science" /></Route>
  <Route path="/sports"><News pageSize={6} country="in" cartegory="sports" /></Route>
  <Route path="/technology"><News pageSize={6} country="in" cartegory="technology" /></Route>
        </Switch>
        </Router>
      </div>
    )
  }
}
